		protected override void m_mthSetPatientFormInfo(clsPatient p_objSelectedPatient)
		{
			m_mthClearUpFormInfo();
			m_objCurrentPatient=p_objSelectedPatient;
			strInPatientID=m_objCurrentPatient.m_StrInPatientID;
			strInPatientDate=p_objSelectedPatient.m_ObjInBedInfo.m_ObjLastSessionInfo.m_DtmEMRInDate.ToString("yyyy-MM-dd HH:mm:ss");
			//this.m_mthDisplayDates(this.txtInPatientID.Text,p_objSelectedPatient.m_ObjCurrentInHospitalInfo.m_StrLastInOfHospitalDate);
			
			this.m_lblOccupation.Text=p_objSelectedPatient.m_ObjPeopleInfo.m_StrOccupation;
			this.m_lblNationnality.Text=p_objSelectedPatient.m_ObjPeopleInfo.m_StrNation;
			this.m_lblHometown.Text=p_objSelectedPatient.m_ObjPeopleInfo.m_StrHomeplace;			
	
			this.m_txtInPatientDiagnose.m_mthInsertText(p_objSelectedPatient.m_ObjPeopleInfo.m_Stradmiss_diag_str,0);
						
			if(p_objSelectedPatient.m_ObjPeopleInfo.m_StrMarried.IndexOf("孤")>=0)
				this.m_rdbMarrage3.Checked=true;
			else if(p_objSelectedPatient.m_ObjPeopleInfo.m_StrMarried.IndexOf("离")>=0)
				this.m_rdbMarrage2.Checked=true;
			else if(p_objSelectedPatient.m_ObjPeopleInfo.m_StrMarried.IndexOf("已")>=0)
				this.m_rdbMarrage1.Checked=true;	
			else if(p_objSelectedPatient.m_ObjPeopleInfo.m_StrMarried.IndexOf("未")>=0)
				this.m_rdbMarrage0.Checked=true;
			
			this.m_mthDisplayDates(strInPatientID,strInPatientDate);
		}

