		private void m_mthEvent_KeyDown(object sender, System.Windows.Forms.KeyEventArgs e)
		{
			switch(e.KeyValue)
			{//F1 112  帮助, F2 113 Save，F3  114 Del，F4 115 Print，F5 116 Refresh，F6 117 Search
				case 13:// enter				

					if(((Control)sender).Name=="m_lsvCommonUseValue")
					{
						m_lsvCommonUseValue_DoubleClick(null,null);
						break;
					}
					if(((Control)sender).Name!="m_txtInPatientDiagnose" && 
						((Control)sender).Name!="m_txtAbonrmalDesc" &&
						((Control)sender).Name!="m_txtSign" &&
						((Control)sender).Name!="m_lsvEmployee" &&
						((Control)sender).Name!="m_txtChargeNurse" &&
						((Control)sender).Name!="m_lsvChargeNurse")
						SendKeys.Send(  "{tab}"); //注意:如果是button控件,则不能send "Tab" 而应该是"Enter",如果是Text控件且允许多行编辑，也不能send "Tab"
					break;

				case 38:
				case 40:					
					if(sender.GetType().Name=="ctlBorderTextBox" && ((ctlBorderTextBox)sender).Name=="txtInPatientID")
					{
						m_lsvInPatientID.Visible=true;						
						if( m_lsvInPatientID.Items.Count>0)
						{
							m_lsvInPatientID.Focus();
							m_lsvInPatientID.Items[0].Selected=true;
							m_lsvInPatientID.Items[0].Focused=true;
						}							
					}	
					if(((Control)sender).Name=="m_cmdGetCommonUseValue0" || ((Control)sender).Name=="m_cmdGetCommonUseValue1")
					{
						m_lsvCommonUseValue.Visible=true;						
						if( m_lsvCommonUseValue.Items.Count>0)
						{
							m_lsvCommonUseValue.Focus();
							m_lsvCommonUseValue.Items[0].Selected=true;
							m_lsvCommonUseValue.Items[0].Focused=true;
						}							
					}	
					break;	

					//				case 46:					
					//					break;
				case 113://save
					this.Save(); 
					break;
				case 114://del
					this.Delete(); 					
					break;
				case 115://print
					this.Print();
					break;
				case 116://refresh
					m_mthClearUp();
					break;
				case 117://Search					
					break;
			}	
		}
