		#region DataControl		
		public void Save()
		{
			
			if(m_blnFormReadOnly==true)
			{
				if(m_trvTime.SelectedNode != m_trvTime.Nodes[0])
					clsPublicFunction.ShowInformationMessageBox("对不起，历史记录不能修改！");
				else if( m_trvTime.Nodes[0].Nodes.Count==0)
					clsPublicFunction.ShowInformationMessageBox("对不起，此病人当前没有入院！");
				else
					clsPublicFunction.ShowInformationMessageBox("请选择入院时间！");
				return;
			}
			if(m_trvTime.SelectedNode !=m_trvTime.Nodes[0].FirstNode)
			{
				clsPublicFunction.ShowInformationMessageBox("对不起，历史记录不能修改!");
				return;
			}
			
			long m_lngRe=this.m_lngSave();
			if(m_lngRe>0)
			{
				if(this.m_trvTime.SelectedNode !=null)
				{
					this.m_trvTime_AfterSelect(this.m_trvTime,new TreeViewEventArgs(this.m_trvTime.SelectedNode));
				}

			}
		}

		private long m_lngSaveWithMessageBox()
		{
			long lngRes=m_lngSaveWithoutMessageBox();
			if(lngRes==-10)
			{
				m_mthShowNoPatient();		
			}
			if(lngRes==-11)
			{
				clsPublicFunction.ShowInformationMessageBox("你所修改的记录已被他人删除或不存在！");				
			}
			else if(lngRes==-21)
			{
				clsPublicFunction.ShowInformationMessageBox("对不起，保存失败！");
			}
			else if(lngRes==-101)
			{
				clsPublicFunction.ShowInformationMessageBox("你正修改的记录已被他人修改！");				
			}
			else if(lngRes==-200)
			{
				m_mthShowDBError();
			}
			return lngRes;
		}
		

		private long m_lngSaveWithoutMessageBox()
		{	
			if(txtInPatientID.Text!=m_objCurrentPatient.m_StrHISInPatientID || txtInPatientID.Text=="")
			{				
				return -10;
			}
			
			if(m_blnCheckUserHasFillAllData()==false)
				return -1;
			
			clsInPatientEvaluate objclsInPatientEvaluate=new clsInPatientEvaluate();
			clsInPatientEvaluateContent objclsInPatientEvaluateContent=new clsInPatientEvaluateContent();
			
			objclsInPatientEvaluate.m_strInPatientID=strInPatientID;
			objclsInPatientEvaluate.m_strInPatientDate=strInPatientDate;			
			objclsInPatientEvaluateContent.m_strInPatientID=strInPatientID;
			objclsInPatientEvaluateContent.m_strInPatientDate=strInPatientDate;			
			objclsInPatientEvaluateContent.m_strModifyDate=DateTime.Now.ToString("yyyy-MM-dd HH:mm:ss");//+((float)(DateTime.Now.Millisecond)/1000f).ToString(".000");
			string strNowTime=objclsInPatientEvaluateContent.m_strModifyDate.Substring(0,19);
			objclsInPatientEvaluateContent.m_strModifyUserID=((clsEmployee)m_txtSign.Tag).m_StrEmployeeID;
			
			clsInPatientEvaluate_All objclsInPatientEvaluate_AllOld;
			long lngSuccess=m_objDomain.m_lngGetLatestRecord_All(strInPatientID,strInPatientDate/*,m_dtpRecordTime.Value.ToString("yyyy-MM-dd HH:mm:ss")*/,out objclsInPatientEvaluate_AllOld);
				
			
			if(lngSuccess>0 && objclsInPatientEvaluate_AllOld !=null && objclsInPatientEvaluate_AllOld.m_objclsInPatientEvaluateContent !=null 
				&& m_objCurrent_clsInPatientEvaluate_All !=null && m_objCurrent_clsInPatientEvaluate_All.m_objclsInPatientEvaluateContent !=null 
				&& DateTime.Parse(objclsInPatientEvaluate_AllOld.m_objclsInPatientEvaluateContent.m_strModifyDate) != DateTime.Parse(m_objCurrent_clsInPatientEvaluate_All.m_objclsInPatientEvaluateContent.m_strModifyDate))
			{//本判断根据最后修改时间的大小比较得到	,只可能大于（被修改）或等于（没修改），不可能小于（此时查询时为空记录）
				m_objCurrent_clsInPatientEvaluate_All=objclsInPatientEvaluate_AllOld;
				m_mthSetNewValue(m_objCurrent_clsInPatientEvaluate_All);//更新显示
				return -101;//若最新记录改变时的返回值
			}			
			else if(lngSuccess<=0)
			{
				//clsPublicFunction.ShowInformationMessageBox("数据错误或数据库连接失败，请与系统管理员联系！");
				return -200;
			}

			if(m_dtpRecordTime.Enabled==false)
			{//修改记录：提取原来记录中的开放时间及创建者				
