					objclsInPatientEvaluate.m_strOpenDate=objclsInPatientEvaluate_AllOld.m_objclsInPatientEvaluate.m_strOpenDate;
					objclsInPatientEvaluate.m_strCreateUserID=objclsInPatientEvaluate_AllOld.m_objclsInPatientEvaluate.m_strCreateUserID;
					objclsInPatientEvaluate.m_strCreateDate=objclsInPatientEvaluate_AllOld.m_objclsInPatientEvaluate.m_strCreateDate;
				}
				else 
				{
					//clsPublicFunction.ShowInformationMessageBox("你所修改的记录已被他人删除或不存在！");
					return -11;
				}
			}
			else
