		/// <summary>
		/// 判断用户已经填写完整所有的栏目
		/// </summary>
		/// <returns></returns>
		private bool m_blnCheckUserHasFillAllData()
		{

			#region 检查各个GroupBox是否赋值			

			//资料来源
			if(this.m_rdbDataFrom0.Checked==false && this.m_rdbDataFrom1.Checked==false && 
				this.m_rdbDataFrom2.Checked==false && this.m_rdbDataFrom3.Checked==false)
			{
				clsPublicFunction.ShowInformationMessageBox("对不起,资料来源选项没有选填");
				m_rdbDataFrom0.Focus();
				m_rdbDataFrom0.Checked=true;
				return false;
			}

			//婚姻状况
//			if(this.m_rdbMarrage0.Checked==false && this.m_rdbMarrage1.Checked==false && 
//				this.m_rdbMarrage2.Checked==false && this.m_rdbMarrage3.Checked==false)
//			{
//				clsPublicFunction.ShowInformationMessageBox("对不起,婚姻状况选项没有选填");
//				m_rdbMarrage0.Focus();
//				m_rdbMarrage0.Checked=true;
//				return false;
//
//			}
			//受教育情况
			if(this.m_rdbEducation0.Checked==false && this.m_rdbEducation1.Checked==false && 
				this.m_rdbEducation2.Checked==false && this.m_rdbEducation3.Checked==false)
			{
				clsPublicFunction.ShowInformationMessageBox("对不起,教育程度选项没有选填");
				m_rdbEducation0.Focus();
				m_rdbEducation0.Checked=true;
				return false;

			}
			//宗教信仰
			if(this.m_rdbReligion0.Checked==false && this.m_rdbReligion1.Checked==false)
			{
				clsPublicFunction.ShowInformationMessageBox("对不起,宗教信仰选项没有选填");
				m_rdbReligion0.Focus();
				m_rdbReligion0.Checked=true;
				return false;

			}
			//入院诊断
			if(this.m_txtInPatientDiagnose.Text.Trim()=="" )
			{
				clsPublicFunction.ShowInformationMessageBox("对不起,入院诊断没有填写");
				m_txtInPatientDiagnose.Focus();
				return false;
			}

			#region 入院方式			
			if(m_rdbInPatientMode0.Checked==false &&m_rdbInPatientMode1.Checked==false && m_rdbInPatientMode2.Checked==false && m_rdbInPatientMode3.Checked==false)
			{
				clsPublicFunction.ShowInformationMessageBox("对不起,入院方式选项没有选填");
				m_rdbInPatientMode0.Focus();
				m_rdbInPatientMode0.Checked=true;
				return false;
			}
			#endregion

			#region 过敏史
			if(m_rdbAllergicHistory0.Checked==false &&m_rdbAllergicHistory1.Checked==false &&m_rdbAllergicHistory2.Checked==false)
			{
				clsPublicFunction.ShowInformationMessageBox("对不起,过敏史选项没有选填");
				m_rdbAllergicHistory0.Focus();
				m_rdbAllergicHistory0.Checked=true;
				return false;
			}
			#endregion

			#region 食欲
			if(m_rdbAppetite0.Checked==false &&m_rdbAppetite1.Checked==false &&m_rdbAppetite2.Checked==false)
			{
				clsPublicFunction.ShowInformationMessageBox("对不起,食欲选项没有选填");
				m_rdbAppetite0.Focus();
				m_rdbAppetite0.Checked=true;
				return false;
