		/// <summary>
		/// 得到界面GroupBox的垂直偏移
		/// </summary>
		/// <param name="p_gpbSelectedGroupBox"></param>
		/// <returns></returns>
		private int m_intGetGroupBoxVOffset(Control p_ctlControl)
		{
			int intRows=0;

			#region 各个GroupBox以及异常信息所在位置偏移行数的赋值	
			
			string strControlName=p_ctlControl.Name;
			switch(strControlName)
			{			

					// 食欲//体重
				case "m_gpbAppetite" :					
				case "m_gpbWeight":
					intRows= 1;
					break;

					// 口腔//咀嚼// 吞咽
				case "m_gpbMouth" :					
				case "m_gpbChaw" :
				case "m_gpbDeglutition" :
					intRows= 2;
					break;
				
					//胃肠				
				case "m_gpbStomach" :
					intRows= 3;
					break;

					// 皮肤
				case "m_gpbSkin" :				
					intRows= 4;
					break;

					// 咳嗽// 痰
				case "m_gpbChogh" :					
				case "m_gpbPhlegm" :				
					intRows= 5;			
					break;

					// 排尿
				case "m_gpbPee" :
					intRows= 6;
					break;

					// 排便
				case "m_gpbDejecta" :
					intRows= 7;
					break;

					// 自理能力// 活动气促
				case "m_gpbCanMyself" :
				case "m_gpbBreathUrge" :
					intRows= 8;
					break;

					// 四肢活动
				case "m_gpbLimbActive" :
					intRows= 9;
					break;

					//睡眠
				case "m_gpbSleep" :
					intRows= 10;
					break;

					// 辅助睡眠
				case "m_gpbAssistantSleep" :
					intRows= 11;
					break;

					//意识状态
					//case "m_gpbShout" :				
					//case "m_gpbAnswer" :				
				case "m_gpbConsciousness" :
					intRows= 12;
					break;

					// 视力
				case "m_gpbSeeingBalk" :
					intRows= 13;
					break;

					// 听力
				case "m_gpbListenBalk" :
					intRows= 14;
					break;

					//疼痛
				case "m_gpbAche" :
					//case "m_gpbAcheTimes" :
					intRows= 15;
					break;

					// 语言
				case "m_gpbLanguage" :
					//case "m_gpbMandarin" :
					intRows= 16;			
					break;	

					// 对住院感觉//希望朋友//家庭经济
				case "m_gpbInHospitalFeel" :
				case "m_gpbLookIn" :
				case "m_gpbEconomic" :
					intRows= 17;
					break;				

					// 对疾病认识//遵医嘱
				case "m_gpbIllnessUnderstand" :					 
				case "m_gpbDoctorsAdvice" :
					intRows= 18;					
					break;

					// 吸烟//嗜酒
				case "m_gpbIfSmoking" :
				case "m_gpbIfDrink" :
					intRows= 19;				
					break;

					// 吸毒
				case "m_gpbFreakOut" :
					intRows= 20;
					break;

					//最后一行
//				case "m_lblAbonrmalDesc":
//				case "m_txtAbonrmalDesc":
				case "pnlFinal" :
					intRows=21;
					break;

				default : intRows= 0;break;		
			}			
			
			#endregion 赋值

			int intVOffset=0;
			if(intRows<14)
				intVOffset=intRows * 100;//除视力听力外，界面所有DataGrid高度为100
			else if(intRows==14)
				intVOffset=intRows * 100 +28;//视力听力的DataGrid高度为128
			else intVOffset=intRows * 100 +28 *2 ;
			return intVOffset;
		}

