		/// <summary>
		/// 此时p_strInPatientDate对应的只有一条记录，所以读出所有以往的住院时间对应的记录（只读），若当前住院时间在本单的记录中
		/// 存在，照常操作，否则，添加当前入院时间到树中（对应空白记录）
		/// </summary>
		/// <param name="p_strInPatientID"></param>
		/// <param name="p_strInPatientDate">最新住院时间（此时仅作为比较是否已经存在该时间之用，不作为查询数据库的条件操作）</param>
		private void m_mthDisplayDates(string p_strInPatientID,string p_strInPatientDate)
		{			
			if(m_trvTime.Nodes.Count==0)
				m_trvTime.Nodes.Add("入院时间");
			m_trvTime.Nodes[0].Nodes.Clear();
			string[] strDateArr ;
			long lngRes=m_objDomain.m_lngGetAllRecordDateArr(p_strInPatientID,out strDateArr);			
			if(lngRes>0 && strDateArr!=null)
			{
				string strDate="";
				for(int i=0;i<strDateArr.Length;i++)
				{
					strDate=DateTime.Parse(strDateArr[i]).ToString("yyyy-MM-dd HH:mm:ss");					
					TreeNode trnNew=new TreeNode(strDate);
					m_trvTime.Nodes[0].Nodes.Insert(0,trnNew);							
				}
			
				m_EnmFormEditStatus = MDIParent.enmFormEditStatus.Modify;
			}
			else if(lngRes<=0)
			{
				clsPublicFunction.ShowInformationMessageBox("数据错误或数据库连接失败，请与系统管理员联系！");
				return;
			}
			if(m_trvTime.Nodes[0].Nodes.Count==0 || m_trvTime.Nodes[0].FirstNode.Text != p_strInPatientDate)	//若当前住院时间在本单的记录中不存在，添加当前入院时间到树中
			{
				TreeNode trnNew=new TreeNode(p_strInPatientDate);
				m_trvTime.Nodes[0].Nodes.Insert(0,trnNew);
			}
			m_trvTime.SelectedNode= m_trvTime.Nodes[0].FirstNode;//选中最新的入院时间
		}

		private void m_trvTime_AfterSelect(object sender, System.Windows.Forms.TreeViewEventArgs e)
		{		
			try
			{
				m_mthRecordChangedToSave();

				m_dtpRecordTime.Enabled=false;
				
				if( e.Node.Text.Length==19)
				{
                    long lngRes = 0;
                    if (string.IsNullOrEmpty(m_objBaseCurrentPatient.m_StrRegisterId))
                    {
                        string strRegisterID = string.Empty;
                        lngRes = new clsPublicDomain().m_lngGetRegisterID(m_objCurrentPatient.m_StrPatientID, Convert.ToDateTime(e.Node.Text).ToString("yyyy-MM-dd HH:mm:ss"), out strRegisterID);
                        m_objBaseCurrentPatient.m_StrRegisterId = strRegisterID;
                        m_objCurrentPatient.m_StrRegisterId = strRegisterID;
                    }
                    m_mthIsReadOnly();

                    if (!m_blnCanShowRecordContent())
                    {
                        clsPublicFunction.ShowInformationMessageBox("该病案已归档，当前用户没有查阅权限");
                        return;
                    }


					clsInPatientEvaluate_All objclsInPatientEvaluate_All;
					lngRes=m_objDomain.m_lngGetLatestRecord_All(strInPatientID,strInPatientDate/*,e.Node.Text*/,out objclsInPatientEvaluate_All);
					if(lngRes<=0)
					{
						clsPublicFunction.ShowInformationMessageBox("数据错误或数据库连接失败，请与系统管理员联系！");
						return;
					}
					else if(lngRes>0 && (objclsInPatientEvaluate_All==null ||objclsInPatientEvaluate_All.m_objclsInPatientEvaluate==null || objclsInPatientEvaluate_All.m_objclsInPatientEvaluateContent==null ))
					{
						if(strInPatientDate != e.Node.Text)
						{
							clsPublicFunction.ShowInformationMessageBox("对不起,该条记录已被他人删除或不存在！");
							m_objCurrent_clsInPatientEvaluate_All=null;
							m_mthSetControlReadOnly(this,true);
							m_mthAddFormStatusForClosingSave();
							//当前处于禁止输入状态
							MDIParent.m_mthChangeFormText(this,MDIParent.enmFormEditStatus.None );
							return;
						}
						else
						{
							m_dtpRecordTime.Enabled=true;
							m_mthClearUpFormInfo();
							m_blnFormReadOnly=false;
							m_mthSetControlReadOnly(this,m_blnFormReadOnly);
							m_mthSetRichTextModifyColor(this,clsHRPColor.s_ClrInputFore);
							m_mthSetRichTextCanModifyLast(this,true);
							m_objCurrent_clsInPatientEvaluate_All=null;

							m_mthSetDefaultValue(new clsPatient(strInPatientID));

							//当前处于新增记录状态
							MDIParent.m_mthChangeFormText(this,MDIParent.enmFormEditStatus.AddNew);

							m_mthAddFormStatusForClosingSave();

							return;//当前为空记录，进入添加记录状态
						}
					}					
										
					strInPatientDate=e.Node.Text;
					m_lblInHospitalDate.Text=e.Node.Text;	
					m_objCurrent_clsInPatientEvaluate_All=objclsInPatientEvaluate_All;
					m_mthSetNewValue(m_objCurrent_clsInPatientEvaluate_All);		
								
					//当前处于修改记录状态
					MDIParent.m_mthChangeFormText(this,MDIParent.enmFormEditStatus.Modify );

					m_mthAddFormStatusForClosingSave();
				}
				else 
				{
					m_mthClearUpFormInfo();
					m_dtpRecordTime.Value=DateTime.Now;

					//当前处于禁止输入状态
					MDIParent.m_mthChangeFormText(this,MDIParent.enmFormEditStatus.None );

					m_mthAddFormStatusForClosingSave();
				}

				if(strInPatientDate != e.Node.Text)
					m_blnFormReadOnly=true;		
				else m_blnFormReadOnly=false;	
				m_mthSetControlReadOnly(this,m_blnFormReadOnly);
				
			}
			catch(Exception ex)
			{
				clsPublicFunction.ShowInformationMessageBox(ex.Message);
			}
		}

		/// <summary>
		/// 设置窗体中控件的只读属性,
		/// </summary>
		/// <param name="p_ctlControl"></param>
		/// <param name="p_blnReadOnly"></param>
		protected override void m_mthSetControlReadOnly(Control p_ctlControl,bool p_blnReadOnly)
		{
			#region 设置窗体中控件的只读属性,Jacky-2003-6-11	
			string strTypeName = p_ctlControl.GetType().Name;			
			if(strTypeName=="ctlRichTextBox")
				((com.digitalwave.controls.ctlRichTextBox)p_ctlControl).m_BlnReadOnly=p_blnReadOnly;	
			else if(strTypeName=="ctlBorderTextBox" && p_ctlControl.Name != "txtInPatientID" && p_ctlControl.Name != "m_txtBedNO" && p_ctlControl.Name != "m_txtPatientName")
				((ctlBorderTextBox)p_ctlControl).ReadOnly=p_blnReadOnly;
			else if(strTypeName=="RichTextBox" )
				((RichTextBox)p_ctlControl).ReadOnly=p_blnReadOnly;
//			else if(strTypeName=="DataGrid" )//本窗体中所有的DataGrid都必须只读
//				((DataGrid)p_ctlControl).ReadOnly=p_blnReadOnly;	
			else if(strTypeName=="CheckBox" || strTypeName=="RadioButton" )
				p_ctlControl.Enabled= !p_blnReadOnly;	
			
			if(p_ctlControl.HasChildren && strTypeName!="DataGrid")
			{									
				foreach(Control subcontrol in p_ctlControl.Controls)
				{										
					m_mthSetControlReadOnly(subcontrol,p_blnReadOnly);						
				} 	
			}						
			#endregion
		}

