		/// </summary>
		/// <returns></returns>
		private bool m_blnGetCanModifyLast(clsInPatientEvaluateContent p_objclsInPatientEvaluateContent)
		{			
			if(p_objclsInPatientEvaluateContent==null || p_objclsInPatientEvaluateContent.m_strModifyUserID.Trim() == MDIParent.OperatorID.Trim())
				return true;
			else 
				return false;
		}

		
