		#region 添加异常功能
		private void m_mniAddAbnormal_Click(object sender, System.EventArgs e)
		{
			Control ctlSelectedControlItem;
			if(((MenuItem)sender)==m_mniAddAbnormal)
				ctlSelectedControlItem = m_cmuAddAbnormal.SourceControl;
			else 
				ctlSelectedControlItem=m_txtFocusedRichTextBox;//m_cmuRichTextBoxMenu.SourceControl;
			if(ctlSelectedControlItem==null)
				return;
			string strAbnormalDesc = m_strGetAbonormalDesc(ctlSelectedControlItem);
			if(strAbnormalDesc.Trim() == "")
				return;
			if(m_txtAbonrmalDesc.Text.Trim() == "")
				m_txtAbonrmalDesc.Text = strAbnormalDesc;
			else
				m_txtAbonrmalDesc.Text = m_txtAbonrmalDesc.Text.Trim() + "\r\n" + strAbnormalDesc;
		}
		private void m_mthAddContextMenuToEachControl(Control p_ctlContainer)
		{			
			foreach(Control ctlItem in p_ctlContainer.Controls)
			{
				if(ctlItem.GetType().Name != "DataGrid" && ctlItem.GetType().Name != "Label" )
				{					
					if(ctlItem.ContextMenu ==null)
					{
						if(ctlItem.Name =="txtInPatientID" || ctlItem.Name =="m_txtPatientName"|| ctlItem.Name =="m_txtBedNO"|| ctlItem.Name =="m_cboArea"|| ctlItem.Name =="m_trvTime" || ctlItem.Name =="m_dtpRecordTime")
							continue;
						ctlItem.ContextMenu = m_cmuAddAbnormal;
					}
					if(ctlItem.HasChildren )
						m_mthAddContextMenuToEachControl(ctlItem);	
				}
			}
		}

