					strResult +=	m_rdbFreakOut1.Checked ? m_rdbFreakOut1.Text +" (名称: "+ m_txtFreakOutMedicines.m_strGetRightText().Trim()+", "+ m_txtFreakOutYears.m_strGetRightText().Trim() +"年,　"+ m_txtFreakOutQtyOneDay.m_strGetRightText().Trim()+"剂量／日)" : "";																
				#endregion	
					break;

