					else
					{
						strResult +=	m_rdbSeeingBalk1.Text+"\r\n";
						if(m_chkLeftEyeDown.Checked || m_chkLeftEyeBlur.Checked || m_chkLeftEyeAgain.Checked ||m_chkLeftEyeOther.Checked)
