							strResult +="\t\t左眼:";
							strResult +=	m_chkLeftEyeDown.Checked ? m_chkLeftEyeDown.Text +",": "";
							strResult +=	m_chkLeftEyeBlur.Checked ? m_chkLeftEyeBlur.Text +",": "";
							strResult +=	m_chkLeftEyeAgain.Checked ? m_chkLeftEyeAgain.Text +",": "";
							strResult +=	m_chkLeftEyeOther.Checked ? m_chkLeftEyeOther.Text + m_txtLeftEyeOtherContent.m_strGetRightText().Trim() : "";
							strResult +="\r\n";
						}
						if(m_chkRightEyeDown.Checked || m_chkRightEyeBlur.Checked || m_chkRightEyeAgain.Checked ||m_chkRightEyeOther.Checked)
