							strResult +=	m_chkRightEyeDown.Checked ? m_chkRightEyeDown.Text +",": "";
							strResult +=	m_chkRightEyeBlur.Checked ? m_chkRightEyeBlur.Text +",": "";
							strResult +=	m_chkRightEyeAgain.Checked ? m_chkRightEyeAgain.Text +",": "";
							strResult +=	m_chkRightEyeOther.Checked ? m_chkRightEyeOther.Text + m_txtRightEyeOtherContent.m_strGetRightText().Trim() : "";
							strResult +="\r\n";
						}
						if(m_chkBothEyeDown.Checked || m_chkBothEyeBlur.Checked || m_chkBothEyeAgain.Checked ||m_chkBothEyeOther.Checked)
						{
							strResult +="\t\t双眼:";
							strResult +=	m_chkBothEyeDown.Checked ? m_chkBothEyeDown.Text +",": "";
							strResult +=	m_chkBothEyeBlur.Checked ? m_chkBothEyeBlur.Text +",": "";
							strResult +=	m_chkBothEyeAgain.Checked ? m_chkBothEyeAgain.Text +",": "";
							strResult +=	m_chkBothEyeOther.Checked ? m_chkBothEyeOther.Text + m_txtBothEyeOtherContent.m_strGetRightText().Trim() : "";																
						}
					}
				#endregion
					break;

				#region 听力
				case "m_gpbListenBalk" :
					if(m_rdbListenBalk0.Checked)
						strResult += m_rdbListenBalk0.Text;
					else
					{
						strResult +=	m_rdbListenBalk1.Text+"\r\n";	
						if(m_chkLeftListenDown.Checked || m_chkLeftListenTinnitus.Checked || m_chkLeftListenAgain.Checked ||m_chkLeftListenOther.Checked)
						{
							strResult +="\t\t左耳:";
							strResult +=	m_chkLeftListenDown.Checked ? m_chkLeftListenDown.Text +",": "";
							strResult +=	m_chkLeftListenTinnitus.Checked ? m_chkLeftListenTinnitus.Text +",": "";
							strResult +=	m_chkLeftListenAgain.Checked ? m_chkLeftListenAgain.Text +",": "";
							strResult +=	m_chkLeftListenOther.Checked ? m_chkLeftListenOther.Text + m_txtLeftListenOtherContent.m_strGetRightText().Trim() : "";
							strResult +="\r\n";
						}
						if(m_chkRightListenDown.Checked || m_chkRightListenTinnitus.Checked || m_chkRightListenAgain.Checked ||m_chkRightListenOther.Checked)
						{
							strResult +="\t\t右耳:";
							strResult +=	m_chkRightListenDown.Checked ? m_chkRightListenDown.Text +",": "";
							strResult +=	m_chkRightListenTinnitus.Checked ? m_chkRightListenTinnitus.Text +",": "";
							strResult +=	m_chkRightListenAgain.Checked ? m_chkRightListenAgain.Text +",": "";
							strResult +=	m_chkRightListenOther.Checked ? m_chkRightListenOther.Text + m_txtRightListenOtherContent.m_strGetRightText().Trim() : "";
							strResult +="\r\n";
						}
						if(m_chkBothListenDown.Checked || m_chkBothListenTinnitus.Checked || m_chkBothListenAgain.Checked ||m_chkBothListenOther.Checked)
						{
							strResult +="\t\t双耳:";
							strResult +=	m_chkBothListenDown.Checked ? m_chkBothListenDown.Text +",": "";
							strResult +=	m_chkBothListenTinnitus.Checked ? m_chkBothListenTinnitus.Text +",": "";
							strResult +=	m_chkBothListenAgain.Checked ? m_chkBothListenAgain.Text +",": "";
							strResult +=	m_chkBothListenOther.Checked ? m_chkBothListenOther.Text + m_txtBothListenOtherContent.m_strGetRightText().Trim() : "";
						}						
					}
				#endregion	
					break;
				default : strResult=" ";break;		
			}			
			return strResult;
			#endregion GroupBox的赋值
		}

		private string m_strGetAbonormalDesc(Control p_ctlSelectedControlItem)
		{
			
			try
			{	
				string strResult="";
				string strTypeName=p_ctlSelectedControlItem.GetType().Name;
				if(strTypeName !="GroupBox" && p_ctlSelectedControlItem.Parent.GetType().Name=="GroupBox")
				{
					strResult=m_strGetGroupBoxText((GroupBox)(p_ctlSelectedControlItem.Parent));
				}
				else if(strTypeName =="GroupBox")
					strResult=m_strGetGroupBoxText((GroupBox)(p_ctlSelectedControlItem));
				else if(p_ctlSelectedControlItem.Name=="m_txtInPatientDiagnose")
				{
					strResult="入院诊断:"+m_txtInPatientDiagnose.m_strGetRightText().Trim();					
				}

				if(strResult.Substring(strResult.Length-1)==",")
					strResult=strResult.Remove(strResult.Length-1,1);
				if(strResult.Substring(strResult.Length-2).IndexOf("。") <0)
					strResult +="。";
				return strResult;
				
			}
			catch(Exception err)
			{
				MessageBox.Show(err.Source.ToString()+": "+err.Message);
				return null;
			}
		}
		/// <summary>
		/// 从别的窗体得到有关的异常信息
		/// </summary>
		/// <param name="p_strAbnormalInfo">异常信息</param>
		public void m_mthSetAbnormalInfoFromOtherForms(string p_strAbnormalInfo)
		{
			if(p_strAbnormalInfo == "")
				return;
			m_txtAbonrmalDesc.Text = m_txtAbonrmalDesc.Text + "\r\n" + p_strAbnormalInfo.Trim();
		}
