			m_lsvCommonUseValue.Items.Clear();			
			clsCommonUseValue[] objclsCommonUseValue=null;			
			new clsCommonUseDomain().m_lngGetAllCommonUseValue("0",out objclsCommonUseValue);
			if(objclsCommonUseValue!=null)
