		private void m_lsvCommonUseValue_DoubleClick(object sender, System.EventArgs e)
		{
			if(m_lsvCommonUseValue.SelectedItems.Count>0)
			{				
				if(m_intCommonUseType==0)
				{					
					this.m_txtAllergicSource. m_mthInsertText( (m_txtAllergicSource.Text.Trim()==""? (m_lsvCommonUseValue.SelectedItems[0].SubItems[1].Text ): ("、"+m_lsvCommonUseValue.SelectedItems[0].SubItems[1].Text)),m_txtAllergicSource.Text.Length);
				}
				else if(m_intCommonUseType==1)
				{				
					this.m_txtAllergicSymptom. m_mthInsertText( (m_txtAllergicSymptom.Text.Trim()==""? (m_lsvCommonUseValue.SelectedItems[0].SubItems[1].Text): ("、"+m_lsvCommonUseValue.SelectedItems[0].SubItems[1].Text)),m_txtAllergicSymptom.Text.Length);
				}
			}	
            //m_objBorderTool.m_mthUnChangedControlBorder(m_lsvCommonUseValue );
			this.m_lsvCommonUseValue.Visible=false;
			
		}

