		/// <summary>
		/// 获取当前病人的作废内容
		/// </summary>
		/// <param name="p_dtmRecordDate">记录日期</param>
		/// <param name="p_intFormID">窗体ID</param>
		protected override void m_mthGetDeactiveContent(DateTime p_dtmRecordDate,int p_intFormID)
		{
			try
			{				
				if(m_trvTime.SelectedNode.Text.Length==19)
				{		
					clsInPatientEvaluate_All objclsInPatientEvaluate_All;
					long lngRes=m_objDomain.m_lngGetLatestDeleteRecord_All(strInPatientID,strInPatientDate,p_dtmRecordDate.ToString("yyyy-MM-dd HH:mm:ss"),out objclsInPatientEvaluate_All);
					if(lngRes<=0)
					{
						clsPublicFunction.ShowInformationMessageBox("数据错误或数据库连接失败，请与系统管理员联系！");
						return;
					}		
										
					strInPatientDate=m_trvTime.SelectedNode.Text;
					m_lblInHospitalDate.Text=m_trvTime.SelectedNode.Text;	
					m_objCurrent_clsInPatientEvaluate_All=objclsInPatientEvaluate_All;
					m_mthSetDeleteValue(m_objCurrent_clsInPatientEvaluate_All);					
				}
				else 
				{
					m_mthClearUpFormInfo();
					m_dtpRecordTime.Value=DateTime.Now;
				}
				
			}
			catch(Exception ex)
			{
				clsPublicFunction.ShowInformationMessageBox(ex.Message);
			}
		}

		private void m_mthSetDeleteValue(clsInPatientEvaluate_All p_objclsInPatientEvaluate_All)
		{
			if(p_objclsInPatientEvaluate_All ==null || p_objclsInPatientEvaluate_All.m_objclsInPatientEvaluate==null || p_objclsInPatientEvaluate_All.m_objclsInPatientEvaluateContent==null)
				return;

			m_mthClearUpRichText(this);//RichTextBox赋新值之前必须清空				
			
			#region 显示已被删除的记录

			clsInPatientEvaluate objclsInPatientEvaluate=p_objclsInPatientEvaluate_All.m_objclsInPatientEvaluate;
			clsInPatientEvaluateContent objclsInPatientEvaluateContent=p_objclsInPatientEvaluate_All.m_objclsInPatientEvaluateContent;
			
			switch(objclsInPatientEvaluate.m_strEducation)
			{
				case  "0":
					m_rdbEducation0.Checked=true;break;
				case  "1":
					m_rdbEducation1.Checked=true;break;
				case "2":
					m_rdbEducation2.Checked=true;break;
				case "3":
					m_rdbEducation3.Checked=true;break;					
				default : 
					m_rdbEducation0.Checked=true;break;
			}	

			switch(objclsInPatientEvaluate.m_strReligion)
			{
				case  "False": case "0":
					m_rdbReligion0.Checked=true;break;
				case  "True":  case "1":
					m_rdbReligion1.Checked=true;
					m_txtReligionContent.Text=objclsInPatientEvaluate.m_strReligionContent;
					m_txtReligionContent.ReadOnly=false;
					break;
				default : 
					m_rdbReligion0.Checked=true;break;
			}		
			
			switch(objclsInPatientEvaluate.m_strDataFrom)
			{
				case  "0":
					m_rdbDataFrom0.Checked=true;break;
				case  "1":
					m_rdbDataFrom1.Checked=true;break;
				case "2":
					m_rdbDataFrom2.Checked=true;break;
				case "3":
					m_rdbDataFrom3.Checked=true;
					m_txtDataFromOtherContent.Text=objclsInPatientEvaluate.m_strDataFromOtherContent;
					m_txtDataFromOtherContent.ReadOnly=false;
					break;
				default : 
