			m_objCUTC.m_mthBindControl(new Control[]{m_cmdGetCommonUseValue0,m_cmdGetCommonUseValue1,m_cmdHowMuchWeight,
				m_cmdAlwayslanguage,m_cmdDejectaCharacter,m_cmdPhlegmColor,m_cmdStomachColor,m_cmdStomachCharacter,
			m_cmdParalysisPart,m_cmdAssistantSleepModel,m_cmdAchePart,m_cmdFreakOutMedicines},
