								 m_txtParalysisPart,m_txtAssistantSleepModel,m_txtAchePart,m_txtFreakOutMedicines},
				new enmCommonUseValue[]{(enmCommonUseValue)0,(enmCommonUseValue)1,
				enmCommonUseValue.frmInPatientEvaluate_HowMuchWeight,enmCommonUseValue.frmInPatientEvaluate_Alwayslanguage,
				enmCommonUseValue.frmInPatientEvaluate_DejectaCharacter,enmCommonUseValue.frmInPatientEvaluate_PhlegmColor,
			enmCommonUseValue.frmInPatientEvaluate_StomachColor,enmCommonUseValue.frmInPatientEvaluate_StomachCharacter,
			enmCommonUseValue.frmInPatientEvaluate_ParalysisPart,enmCommonUseValue.frmInPatientEvaluate_AssistantSleepModel,
			enmCommonUseValue.frmInPatientEvaluate_AchePart,enmCommonUseValue.frmInPatientEvaluate_FreakOutMedicines});
