        protected override void m_mthPerformSessionChanged(clsEmrPatientSessionInfo_VO p_objSelectedSession, int p_intIndex)
        {
            if (p_objSelectedSession == null) return;
            if (m_trvTime == null) return;

            m_trvTime.SelectedNode = m_trvTime.Nodes[0];
            if (m_trvTime.Nodes[0].Nodes.Count > 0)
            {
                foreach (TreeNode node in m_trvTime.Nodes[0].Nodes)
                {
                    if (DateTime.Parse(node.Text) == p_objSelectedSession.m_dtmHISInpatientDate)
                    {
                        m_trvTime.SelectedNode = node;
                        if (!m_trvTime.Visible)
                            m_trvTime_AfterSelect(m_trvTime, new TreeViewEventArgs(node, TreeViewAction.ByMouse));
                        return;
                    }
                }
            }
        }
	}	
